import classes from './projets.module.css'
import Pageheader from '../pageheader/pageheader';

const Projets = () => {
    return ( 
        <div className={classes.Container} id='projets'>
            <Pageheader title={'Projets'}/>
            <h1>Projets</h1>
        </div>
     );
}

export default Projets;
